  JWILLIAMS, James Busby (Jim) and KEILLER, Muriel Cecile
  01> WILLIAMS, James Busby (Jim) m on 03.09.1925 to KEILLER, Muriel Cecile
  b 15.03.1900 d 11.03.1977
  b 06.02.1903 d 12.08.1995
  James b. and d. at Gisborne. Cecile, d/o Edwin Keiller and Muriel Katharine Waite.
  Jim was educated at Christ's College (1914-18) where he played for the 1st rugby XV for
  three years and was captain of the 1st XV and head prefect in the last year,
  He purchased "Mokonui" station in 1925 and eventually retired from "Mokonui" to "Kaimoe"
  station. He served as Deputy Mayor of Gisborne and was Chairman of the Cook Hospital Board
  for 25 years. While at Mokanui he was a Waikahu County Councillor. Jim was also a director
  of Williams and Kettle Ltd and Adair Brothers Ltd. He was awarded the OBE in recognition for his service to
  the public. Cecile was President of the Hinemateroa Children's Home Committee for 27 years.
  01> WILLIAMS, Elizabeth Keiller (Betty) m on 08.04.1953 to GORDON, Peter McKay
  b 03.06.1926 d 13.01.1993
  b 30.12.1923
  Elizabeth b., m. and d. at Gisborne. Peter, s/o John McKay Gordon and Eva Eileen McKay. Address: 17
  Karina Terrace, Palmerston North.
  Peter is a retired solicitor and Betty is a partner in "Mokonui" station.
  01> GORDON, James McKay m on 27.03.1978 to CORBETT, Jennifer Mary
  b 05.10.1954
  b 05.07.1953
  James m. at Levin. Jennifer, d/o Francis Michael Corbett and Nola Mary Ryder, b, at Otaki, Address:
  36a Ranui Crescent, Khandallah, Wellington.
  James is a taxation consultant and Jennifer is a teacher.
